import React from "react";

import { Form, Button } from "react-bootstrap";
import "./FilterEvents.css";
const FilterEvents = (props) => {


  const filterHandler = (e) => {
    e.prevent
  }

  return (
    <div className="selectForm">
      <div className="text-center"><h5>Filter Events</h5></div>
      <form onSubmit={filterHandler}>
        <Form.Select id="selectFilter" aria-label="Default select example">
          <option></option>
          <option value="1">Tennis</option>
          <option value="2">Football</option>
          <option value="3">badminton</option>
          <option value="3">Volley</option>
          <option value="3">Jogging</option>
        </Form.Select>
        <Form.Select id="selectFilter" aria-label="Default select example">
          <option></option>
          <option value="1">Beginner</option>
          <option value="2">Intermediate</option>
          <option value="3">Pro</option>
        </Form.Select>
        <Button id="btnFilter">Submit</Button>
      </form>
    </div>
  );
};

export default FilterEvents;
